import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";
import {Background, SelectWrapper} from "./styles";

const OptionButton = ({ title, data }) => {
  return (
    <Background>
      <button type="button">
        <p>{ title }</p>
        <KeyboardArrowDownIcon />
      </button>
      <SelectWrapper>
        {
          data.map((list, i) => {
            console.log(list);
            return (
              <button type="button" key={list.code}>
                { list.name }
              </button>
            );
          })
        }
      </SelectWrapper>
    </Background>
  );
};

export default OptionButton;
